// main.js
import { createApp } from 'vue';
import App from './App.vue';
import LoginForm from "./components/logiForm.vue"; 
import Dashboard from "./components/attendenceForm.vue"; 
import Navigation from "./components/theNavigation.vue"
import leave from "./components/leaveForm.vue";
import attendenceLevel from "./components/attendenceLevel.vue"


import { createRouter, createWebHistory } from 'vue-router';

const routes = [
  {
    path: '/',
    component: LoginForm,
    name: 'login',
  },
  {
    path: '/dashboard',
    component: Dashboard,
    name: 'dashboardForm',
    props:true,
  },

  {
    path: '/navigation',
    component: Navigation,
    name: 'navigation',
  },
  {
    path:"/leave",
    component:leave
  },
  {
    path:"/attendenceLevel",
    component:attendenceLevel
  }
];

const router = createRouter({
  history: createWebHistory(),
linkActiveClass:'active-link',
  routes,
});

const app = createApp(App);
app.use(router);
app.component('LoginForm', LoginForm);
app.component('DashboardForm', Dashboard);
app.mount('#app');
